<template>
  
</template>
<script>
export default {
    name: 'name',
    props: {
        value: null
    },
    data() {
        return {}
    },
    methods: {
        init() {
            const head = document.head
            const script = document.createElement('script')
            // script.setAttribute('data-app', '')
            // 
            // 
            script.setAttribute('data-app', '')
            script.src = '//g.alicdn.com/sd/pointman/js/pt.js'
            head.appendChild(script)
            const $this = this
            script.onload = () => {
                const pointman = window.pointman
                pointman.use('do', function() {
                    $this.$emit('input', pointman.getConfig())
                })
            }
        }
    },
    created() {
        this.init()
    }
}
</script>